import React, { Fragment } from 'react';
import NavBar from '../components/navBar/NavBar';

export default class Main extends React.Component {
    render() {
        return (
            <Fragment>
                    <NavBar />
                <article>
                    <section id="about">

                    </section>
                    <section id="experience">

                    </section>
                    <section id="skills">

                    </section>
                    <section id="projects">

                    </section>
                    <section id="contact">

                    </section>
                </article>

            </Fragment>
        );
    }
}
